-- ----------------------------
-- Table structure for mj_order_server
-- ----------------------------
DROP TABLE IF EXISTS `mj_order_server`;
CREATE TABLE `mj_order_server` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) unsigned NOT NULL COMMENT '订单id',
  `server_station_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '服务站点id',
  `assignor_id` int(11) NOT NULL DEFAULT '0' COMMENT '指派人员',
