-- ----------------------------
-- Table structure for mj_pay
-- ----------------------------
DROP TABLE IF EXISTS `mj_pay`;
CREATE TABLE `mj_pay` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) unsigned NOT NULL DEFAULT '0',
  `subject` varchar(64) NOT NULL DEFAULT '' COMMENT '标题',
  `body` text NOT NULL COMMENT '描述',
  `total_fee` decimal(15,2) NOT NULL COMMENT '物品总价',
  `floor_fee` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '楼层费用',
  `floor_memo` varchar(225) NOT NULL DEFAULT '' COMMENT '楼层备注',
  `real_fee` decimal(15,2) NOT NULL COMMENT '实际支付',
  `balance_fee` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '余额支付了多少',
  `other_fee` decimal(15,2) NOT NULL COMMENT 'wechat or alipay',
  `privilege` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '优惠满减，等差数列',
  `privilege_id` int(11) NOT NULL DEFAULT '0' COMMENT '客户优惠券id',
  `privilege_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券优惠价格',
  `customer_card_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '使用哪张卡',
  `code` varchar(32) NOT NULL DEFAULT '' COMMENT '优惠券标示符admin后台',
  `api` varchar(32) NOT NULL DEFAULT '' COMMENT '接口',
  `pay_method` varchar(32) NOT NULL DEFAULT '' COMMENT '支付方式',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `created` int(11) unsigned NOT NULL DEFAULT '0',
  `updated` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `order_status` (`order_id`,`status`),
  KEY `customer_card_id` (`customer_card_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1061 DEFAULT CHARSET=utf8 COMMENT='支付记录表';

-- ----------------------------
-- Records of mj_pay
-- ----------------------------

-- ----------------------------
-- Table structure for mj_privilege
-- ----------------------------
DROP TABLE IF EXISTS `mj_privilege`;
CREATE TABLE `mj_privilege` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '',
  `pathway` varchar(32) NOT NULL DEFAULT '' COMMENT '关键词（关注或者其他）',
  `type` varchar(32) NOT NULL DEFAULT '' COMMENT 'discount折扣券trade_in抵价券',
  `trade_in_price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '抵价券额度',
  `discount` float NOT NULL COMMENT '折扣券折扣9折，9.9折',
  `most_price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '折扣券最高抵价',
  `deadline` int(11) unsigned NOT NULL COMMENT '有效期N天',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `memo` text NOT NULL COMMENT '备注',
  `start_time` int(11) NOT NULL COMMENT '生效开始时间',
  `end_time` int(11) NOT NULL COMMENT '生效结束时间',
  `number` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '该红包最多可分发个数；0是不限',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0不可用1可用',
  `created` int(11) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `four_param` (`pathway`,`start_time`,`end_time`,`status`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='折扣券抵价券表';

-- ----------------------------
-- Records of mj_privilege
-- ----------------------------

-- ----------------------------
-- Table structure for mj_product
-- ----------------------------
DROP TABLE IF EXISTS `mj_product`;
CREATE TABLE `mj_product` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL,
  `price` decimal(15,2) NOT NULL COMMENT '单价',
  `curr_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '特殊时期价格',
  `business_type` varchar(16) NOT NULL DEFAULT '' COMMENT 'clean,fix,install',
  `provider_id` mediumint(8) NOT NULL DEFAULT '0' COMMENT '渠道id',
  `image` varchar(225) NOT NULL DEFAULT '',
  `img_id` int(11) NOT NULL DEFAULT '0',
  `image_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '第二章图片',
  `object_img_id` int(11) NOT NULL DEFAULT '0' COMMENT '实物图',
  `sort` smallint(4) unsigned NOT NULL DEFAULT '1',
  `img_alt` varchar(64) NOT NULL COMMENT '图片alt',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `end_time` int(11) NOT NULL COMMENT '结束时间',
  `time_limit` tinyint(1) NOT NULL COMMENT '0实时1定时',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  `created` int(11) NOT NULL DEFAULT '0',
  `upid` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '父类id',
  PRIMARY KEY (`id`),
  KEY `type_status` (`business_type`,`status`),
  KEY `image_id` (`image_id`)
) ENGINE=InnoDB AUTO_INCREMENT=224 DEFAULT CHARSET=utf8 COMMENT='status';

