  `username` varchar(32) NOT NULL COMMENT '登录账号',
  `worker_no` varchar(16) NOT NULL COMMENT '工号',
  `auth_key` varchar(32) DEFAULT NULL,
  `password_hash` varchar(255) DEFAULT NULL,
  `password_reset_token` varchar(255) DEFAULT NULL,
  `password` varchar(64) NOT NULL COMMENT '密码',
  `name` varchar(64) NOT NULL COMMENT '真实名字',
  `mobile` varchar(32) NOT NULL COMMENT '手机号码',
  `email` varchar(64) NOT NULL COMMENT '邮箱',
  `company_id` mediumint(8) NOT NULL COMMENT '公司id',
  `server_station_id` smallint(4) NOT NULL COMMENT '服务站点id',
  `department_id` tinyint(4) NOT NULL COMMENT '部门id',
  `level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '等级',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1作业部/0非作业部',
  `install` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有安装技能',
  `fix` tinyint(1) NOT NULL DEFAULT '0' COMMENT '维修技能',
  `clean` tinyint(1) NOT NULL DEFAULT '0' COMMENT '清洗技能',
  `avator` varchar(225) NOT NULL DEFAULT '' COMMENT '头像',
  `img_id` int(11) NOT NULL COMMENT '头像id',
  `status` tinyint(2) NOT NULL COMMENT '状态',
  `created_at` int(11) NOT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `login_time` int(11) NOT NULL COMMENT '最近登录时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username_unique` (`username`) USING BTREE,
  KEY `level` (`level`),
  KEY `username` (`username`),
  KEY `email` (`email`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=66 DEFAULT CHARSET=utf8 COMMENT='公司同事表';

