  `account` varchar(32) NOT NULL DEFAULT '' COMMENT '账号',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '名称',
  `mobile` varchar(32) NOT NULL COMMENT '手机',
  `email` varchar(32) NOT NULL COMMENT '邮箱',
  `server_station_id` int(11) NOT NULL DEFAULT '0' COMMENT '服务网点id',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态1启用0禁用',
  `if_install` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否安装服务',
  `if_fix` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否修理服务',
  `if_clean` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否保养服务',
  `pull_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '手机端拉取时间',
  `avatar` varchar(255) NOT NULL COMMENT '头像',
  `img_id` int(11) unsigned NOT NULL,
  `created` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `mobile_status` (`mobile`,`status`),
  KEY `server_station_status_install` (`server_station_id`,`status`,`if_install`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=utf8 COMMENT='线下工人信息表';

